import { useEffect, useState } from "react";

function App2(){
    const [loading, setLoading] = useState(true);
    useEffect(()=>{
        fetch("https://api.coinpaprika.com/v1/tickers");
    }, [])
    return (
        <div>
            <h1>The Coins!</h1>
            {loading ? <strong>Loading...</strong> : ''}
        </div>
    )
}


export default App2;
